import RegInput from "./RegInput";
import { Routes, Route, useLocation, useNavigate } from "react-router-dom";

function MotApp() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<RegInput />} />
      </Routes>
    </div>
  );
}

export default MotApp;
